func testUsdaFoodPortionToOneSetOpUsdaMeasureUnitUsingMeasureUnit(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a UsdaFoodPortion
	var b, c UsdaMeasureUnit

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, usdaFoodPortionDBTypes, false, strmangle.SetComplement(usdaFoodPortionPrimaryKeyColumns, usdaFoodPortionColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	if err = randomize.Struct(seed, &b, usdaMeasureUnitDBTypes, false, strmangle.SetComplement(usdaMeasureUnitPrimaryKeyColumns, usdaMeasureUnitColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	if err = randomize.Struct(seed, &c, usdaMeasureUnitDBTypes, false, strmangle.SetComplement(usdaMeasureUnitPrimaryKeyColumns, usdaMeasureUnitColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = b.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	for i, x := range []*UsdaMeasureUnit{&b, &c} {
		err = a.SetMeasureUnit(ctx, tx, i != 0, x)
		if err != nil {
			t.Fatal(err)
		}

		if a.R.MeasureUnit != x {
			t.Error("relationship struct not set to correct value")
		}

		if x.R.MeasureUnitUsdaFoodPortions[0] != &a {
			t.Error("failed to append to foreign relationship struct")
		}
		if !queries.Equal(a.MeasureUnitID, x.ID) {
			t.Error("foreign key was wrong value", a.MeasureUnitID)
		}

		zero := reflect.Zero(reflect.TypeOf(a.MeasureUnitID))
		reflect.Indirect(reflect.ValueOf(&a.MeasureUnitID)).Set(zero)

		if err = a.Reload(ctx, tx); err != nil {
			t.Fatal("failed to reload", err)
		}

		if !queries.Equal(a.MeasureUnitID, x.ID) {
			t.Error("foreign key was wrong value", a.MeasureUnitID, x.ID)
		}
	}
}

